INSERT INTO `items` (`id`, `name`, `name_en`, `desc`, `origin`, `origin_en`, `created_at`, `updated_at`) VALUES
(2, 'RIO 鸡尾酒 瓶装 275毫升', 'RIO Cocktail Bottled Series 275ML', 'RIO鸡尾酒是一种品牌为rio的鸡尾酒，主要制作配料有：果汁、白兰地、朗姆酒等等。该酒采用鲜榨冷冻技术提纯果汁\r\n\r\n口味:\r\n蓝玫瑰威士忌\r\n黑加仑香橙伏特加\r\n混合水果（宾治）伏特加\r\n紫葡萄白兰地\r\n青柠青瓜朗姆\r\n水蜜桃白兰地\r\n\r\n生产日期：11.2020\r\n保质期：18个月', '中国', 'Cina', '2021-05-06 00:52:07', '2021-05-11 02:05:32'),
(3, '乐事薯片系列', 'Lay\'s Potato Chips', '乐事薯片 ? Lay\'s Potato Chips (70g)\r\n\r\n乐事的品牌理念是“成为让人微笑的品牌”。\r\n\r\n多样变化的口味，让你微笑\r\n乐事多样变化的新鲜口味和多层次的丰富口感不断刺激着消费者的味蕾，带来前所未有的美味体验。味觉的愉悦让消费者不知不觉嘴角上扬，快乐微笑。\r\n\r\n轻松愉悦的品牌个性，让你微笑\r\n“片片刻刻有乐事”是乐事始终如一的品牌标语。从快乐为导向的营销策略，到形象阳光的品牌代言人，再到各种轻松快乐的品牌广告，乐事总是呈现出愉悦欢乐的品牌个性。不仅如此，乐事还希望人们在享受美味薯片的同时，更能感受到品牌传达出来的快乐理念——美味时刻就是欢乐时刻。\r\n\r\n倡导快乐的生活态度，让你微笑\r\n快乐是一种生活态度。在乐事品牌心中，快乐的源泉正是美味到无法抗拒的薯片，可以带给消费者身心的愉悦。小小的薯片，虽然不能改变世界。但是，乐事所倡导的快乐生活态度，却意义重大。\r\n乐事，渴望融入国人生活的每一个欢乐时刻。无论是一个人的享受，还是朋友的相聚，或是家人的团聚，有了乐事，总能为每一段时光增添快乐!\r\n\r\n薄薄薯片，美妙滋味，更承载着中国人情的味道，快乐的味道。片片刻刻有乐事！', '中国', 'China', '2021-05-11 01:33:18', '2021-05-13 10:52:40'),
(4, '乐事 苦芥山药卷黑椒牛扒味80g', 'Lay\'s Bitter Mustard Yam Roll Black Pepper Steak Flavor 80g', '山药对身体有一定的益处,而乐事的这款山药薄片,标榜着跟薯片完全不同的口感,比薯片更薄更脆,好吃到停不下来原来是真的咧!', '中国', 'China', '2021-05-11 01:44:21', '2021-05-13 10:40:01'),
(5, '盼盼 艾比利薯片60g', 'Panpan Abelli Potato Chips 60g', '盼盼 艾比利薯片 (激情香辣味/风情烧烤味) 6 g Panpan Believe Potato Chips (Spicy/Barbeque)\r\n\r\n选用新鲜土豆，片片薄脆?\r\n健康美味，吃得安心?', '中国', 'China', '2021-05-11 01:47:31', '2021-05-13 10:36:42'),
(6, '洽洽 山药脆片75g', 'Qia Qia Yam Chips 75g', '洽洽 山药脆片75g', '中国', 'China', '2021-05-11 01:49:07', '2021-05-11 02:09:00'),
(7, '甘源系列75g', 'Gan Yuan 75g', '甘源所推出的豆系列零食肯定是首选啊！馨香可口 每一口都脆脆爽爽的 而且里面还是独立包装呢！不必担心变软哦✔方便携带\r\n✔独立包装\r\n✔卫生保障', '中国', 'China', '2021-05-11 01:51:02', '2021-05-13 09:40:56'),
(8, '洽洽瓜子108g', 'Qia qia sunflower seeds 108g', '洽洽瓜子不用介绍相信大家肯定都吃过了，除了为你介绍的是洽洽原味瓜子还有各种不同口味瓜子。\r\n各种新颖口味的瓜子分别有焦糖口味、芝士口味、藤椒口味、海盐口味和很韩风的蜂蜜黄油口味!', '中国', 'China', '2021-05-11 01:55:14', '2021-05-13 10:15:23'),
(9, '创食人 系列 88g', 'Chuang Shi Ren 88g', '如果平常吃那些油炸，烘烤的零食吃腻了，小编要介绍与众不同的零食给你！而且是素食者都可以吃的，不是炸鸡也可以好吃到吮手指的卤味零嘴！\r\n创食人的卤味零食，集齐了四种素菜，经过卤制每种都非常入味?\r\n➤ 香辣花生\r\n花生不用说了，每次看到卤花生出现，不到五分钟就会全部被扫光，创食人的香辣花生颗颗饱满，滋味鲜美，卤得刚刚好，辣得恰到好处。\r\n➤ 香辣莲藕\r\n卤制莲藕是来自湖北的风味小吃，味道经过卤制非常鲜美，带点甜的莲藕不管是单吃，还是配饭吃，当下酒菜，都非常地合适。\r\n➤ 香辣毛豆\r\n毛豆是最低卡又蛋白质高的“零嘴”，减肥的人吃毛豆最合适不过了。创食人的香辣毛豆让单调的毛豆多了一点调味，吃起来非常香，当下酒菜也毛问题啦！', '中国', 'China', '2021-05-11 01:57:36', '2021-05-21 03:19:00'),
(10, '小鴨哥鹹蛋餅 & 咸蛋麦片饼', 'salted egg yolk pancake roll ＆ Oat Biscuit', '咸蛋煎饼蛋黄卷 156g\r\nSalted Egg Yolk Pancake Roll\r\n浓浓煎饼咸蛋黄卷\r\n满满的咸蛋黄\r\n非常的松脆不硬‼️', '泰国', 'Thailand', '2021-05-11 02:11:29', '2021-05-13 09:08:34'),
(11, '肮脏包小零食50g', 'Dirty packet snacks 50g', '好吃?美味可口的脏小包\r\n一口一个 浓浓的巧克力味\r\n酥脆酥脆的非常好吃?\r\n而且非油炸 吃的健康不上火\r\n\r\nYummy ? delicious and delicious dirty pouch\r\nOne bite, rich chocolate flavor\r\nCrispy and crispy is very delicious ?\r\nAnd the non-fried food is not healthy', '中国', 'China', '2021-05-11 02:12:35', '2021-05-13 08:41:12'),
(12, '日本波旁饼干', 'Japan Bourbon Biscuit', '◤日本地道美味 ▪ 入口即化的波路梦系列饼干 ◢\r\n口感扎实酥脆 入口即化\r\n美味可口 甜而不腻\r\n简单早餐 / 午后小点心 都很合适\r\n独立包装 方便携带 随时随地享用美味\r\ncrispy & sweet & good taste\r\nquick and easy breakfast / afternoon snacks\r\nindependent packaging, enjoy anytime', '日本', 'Japan', '2021-05-11 02:14:05', '2021-05-13 08:31:37'),
(13, '王小卤虎皮凤爪200g', 'Wang Xiaolu Tiger Skin Chicken Feet 200g', '由于处理的工序繁多，现在已经很少有人肯做了，就算做了，也许也只是单纯的卤凤爪，要做到虎皮效果的凤爪真的是见少买少了。\r\n来自王小卤的虎皮凤爪，为达到虎皮的效果先炸后卤更好吃！王小卤的虎皮凤爪经过人工去甲之后，加入秘制卤汁去卤制，卤汁浓郁，卤好的凤爪鲜香沁骨，连骨都吮干净！卤好的凤爪非常入味，冷吃Q弹，热吃味道更足，个大肉多超过瘾！\r\n➤ 椒麻味\r\n加入椒麻的凤爪犹如舌尖过电般，颠覆你的味蕾，没想到凤爪和椒麻那么有火花！\r\n➤ 香辣味\r\n香辣味简直让人过瘾，辣得上头！越吃越爽，越吃越想吃！\r\n➤ 卤香味\r\n不能吃辣，又不爱吃麻的你，吃卤香味吧，秘制卤汁的味道发挥得淋漓尽致，卤香浓郁，回味无穷。', '中国', 'China', '2021-05-11 02:15:48', '2021-05-13 08:18:37'),
(14, '田小花马卡龙夹心饼干草莓味320g', 'Tian Xiaohua Macaron Sandwich Biscuit Strawberry Flavor 320g', '田小花马卡龙夹心饼干\r\n2盒创意可爱饼干网红甜点下午茶点心休闲零食办公室零食\r\n\r\nMACA-ROON ▪ Colorful World \r\n缤纷世界 ▪ 我想给你所有美好的\r\n迷你马卡龙 口袋小饼干\r\n质地酥脆 夹心顺滑\r\n1盒大约60个独立小包装\r\n存取方便 随身携带\r\nSweet & Crispy & Colorful\r\n1box around 60small packets\r\nEasy carry & enjoy delicious anytime', '中国', 'China', '2021-05-11 02:19:59', '2021-05-13 08:06:17'),
(15, '泰国咸蛋鸡腿饼55g', 'Thai Salted Egg Chicken Leg Cake 55g', '??泰国??必试的?鸡腿饼(Lotus)\r\n好吃又不贵?好吃到停不了口的小鸡腿饼???\r\n\r\n“烦恼时来一袋?，饿了时来一袋??”\r\n“喝酒时来一袋?，看片时来一袋??\r\n-Salted Egg Flavour  \r\n咸蛋辣味\r\n\r\n泰国??(Lotus)鸡腿?零食1包含有55g', '中国', 'China', '2021-05-11 02:21:11', '2021-05-13 08:00:16'),
(16, 'JORNGUAN茉莉花香糯米饼干100g', 'JORNGUAN Jasmine Rice Cracker with Flossy 100g', '??泰国必买手信Jornguan 状元肉松香脆米饼\r\n\r\n驰名泰国的“状元”牌正宗鸡肉松香米脆饼由泰国著名之“茉莉香米”加料精制，其口感鲜脆，再加以精选之高品质鸡肉松增加美味，口感奇佳，男女老幼咸宜，欢迎品尝。', '韩国', 'Korean', '2021-05-11 02:22:51', '2021-05-13 07:52:47'),
(17, '超友味 KK 法式马卡龙软糖 168g', 'Chao You Wei KK French Macaron Gummy 168g', '超友味 KK 法式马卡龙软糖 168g\r\n◤ 可可爱爱 ▪ 高颜值小零嘴 ◢ \r\n小巧缤纷 法式马卡龙软糖\r\n综合什锦 一盒含有多种口味 \r\n精美包装 自己很喜欢 送礼对象也很喜欢 \r\n一口一个 甜蜜滋味 幸福满满', '中国', 'China', '2021-05-11 02:24:02', '2021-05-13 06:07:25'),
(18, '雅吻硬糖 350克', 'Ya kiss hard candy 350g', '雅吻硬糖 350克', '中国', 'China', '2021-05-11 02:25:17', '2021-05-11 02:26:42'),
