(37, 'RIO鸡尾酒 罐装 330ml', 'RIO cocktail can 330ml', '适合女生喝的RIO微醺小酒?\r\n\r\n?萌檬红茶\r\n酸酸甜甜的柠檬蒙搭配红茶，味道比较清爽可口，感觉就算\r\n是不怎么喜欢酒精味道的女生也可以接受！\r\n\r\n?乐橋乌龙橘子\r\n?橘子搭配乌龙茶这款我也很喜欢〜还有小气泡在舌尖上跳动，是惬意的感觉！\r\n\r\n?玫瑰荔枝白兰地\r\n这个好好喝，是荔枝香气的味道，我还会往里面扔几个荔枝跟冰块〜\r\n\r\n?白桃白兰地\r\n外观粉粉的，一看就是少女酒，喝起来桃子?香气十足?\r\n\r\n?乳酸菌伏特加\r\n是养乐多的味道！感觉是新大陆，我以前都不知道乳酸菌搭配伏特加那么?\r\n\r\n?百香果伏特加\r\n入口就是酸酸甜甜的百香果味道啦〜还可以往里加点新鲜的百香果更好喝喔！\r\n\r\n?葡萄白兰地\r\n有点葡萄酒?的感觉，微微的酸但没有会涩的口感，感觉比较适合聚会的时候！\r\n\r\n?西柚伏特加\r\n这个感觉就没那么甜，会有一点点微甘的感觉，是西柚的那种甘香味道。\r\n\r\n?柠檬朗姆\r\n这个会有点儿?苦的感觉，但是是能接受的那种朗姆酒的味道，男生会比较喜欢！', '中国', 'China', '2021-05-11 03:28:56', '2021-05-12 11:57:03'),
(38, 'Jinro 韩国酒 360ml', 'Jinro Soju 360ml', 'Also known as Korean vodka, it has a very smooth taste. It’s a clear distilled liquor made from rice and the most popular type of alcoholic drink in Korea.\r\n\r\nSoju is originally from Korea, where it was first distilled around the 14th century. Unlike vodka, soju has a natural hint of botanicals that can make for a smoother taste as opposed to vodka, which can sometimes come off as harsh at the end. It is also not only lower in calorie than vodka, but it is also lower in proof.\r\n\r\nSweet green grape meets morning dew for the best flavor\r\nFruit juice in soju is becoming more popular, and Jinro Green Grape has unique green grape flavor and taste that everyone can enjoy. Easy to drink with an alcohol content of 13%, it has such a clean and fresh flavor that will capture your heart.', '韩国', 'Korea', '2021-05-11 03:32:16', '2021-05-12 11:55:01'),
(39, '农夫山泉茶π 500ml', 'Nong Fu Shan Quan Tea π 500ml', '多重口味茶兀饮料～\r\n喝上去淡淡花香带点清甜水果味道！\r\n丰富营养，好喝不腻！\r\nBigBang G Dragon 代言的农夫山泉茶兀?\r\n\r\n【5种口味】\r\n?玫瑰荔枝红茶 \r\n精选锡兰红茶，融入玫瑰花香，荔枝果香，香气袭人，回味悠长\r\n?西柚茉莉花茶 \r\n精选茉莉银豪，窖花3-7次，融入西柚果香，清新怡人\r\n?蜜桃乌龙茶 \r\n选用闽南铁观音乌龙茶为原料，采用春茶鲜叶精制，与蜜桃果香完美融合\r\n?柚子绿茶 \r\n甄选江南优质炒青绿茶为原料，鲜爽清新\r\n?柠檬红茶 \r\n精选优质红茶为原料，加入柠檬果汁，回味绵长', '中国', 'China', '2021-05-11 03:34:17', '2021-05-12 11:52:32'),
(40, '康师傅饮料500ml', 'Master Kong Drink 500ml', '康师傅除了以选择多到爆以及非常好吃的泡面闻名之外，有件事情小编也必须告诉你，就是他们家的饮料选择也很多，味道都是棒棒哒！', '中国', 'China', '2021-05-11 17:54:10', '2021-05-13 11:37:01'),
(41, '名屋果汁牛乳500ml', 'Ming Wu Juice Milk 500ml', '风靡台湾大街小巷的美味饮料来啦！\r\n去过宝岛的朋友肯定都知道，尤其木瓜牛乳这款饮料在台湾可是很受欢迎的哦~每个小店里面都有它的身影。', '台湾', 'Taiwan', '2021-05-11 20:37:47', '2021-05-12 11:46:24'),
(42, '名屋果汁500ml', 'Ming Wu Juice 500ml', '台湾的名屋果汁真的是非常非常有名气了啦！\r\n名屋的果汁系列多种口味\r\n黄金配比，溢入好滋味！！\r\n\r\n新鲜水果真的非常鲜甜不腻口哦！！', '台湾', 'Taiwan', '2021-05-11 20:39:50', '2021-05-12 11:48:57'),
(43, '营养快线 酸奶450ml', 'Nutrition Express Yogurt 450ml', '营养快线中牛奶含量超过30%，也就是一瓶500毫升的营养快线中主要含有大于150毫升的牛奶，还含有约25毫升的果汁以及25克的糖，其中果汁含有大量的水果纤维及丰富的维生素.', '中国', 'China', '2021-05-11 21:47:40', '2021-05-12 11:30:54'),
