(45, '王老吉吸吸龟苓膏258g', 'Wanglaoji Sucking Turtle Paste 258g', '这个炎热马来西亚 就应该时常吃龟苓膏解凉 而且小包方便携带 放进包包随时拿出来吃都超级方便', '中国', 'China', '2021-05-11 21:52:03', '2021-05-12 11:11:45'),
(47, '王老吉山楂陈皮＆咸柑桔', 'Wanglaoji Hawthorn Tangerine Peel＆Salted Citrus', 'WangLaoJi Salted Citrus & Hawthorn Tangerine 王老吉植韵 咸柑桔 & 山楂陈皮\r\n解暑，解腻，减脂的好饮品', '中国', 'China', '2021-05-11 21:55:19', '2021-05-12 11:01:24'),
(48, '水恋湾 280ml', 'Shui Lian Wan 280ml', '抖音网红饮料可以让你一秒变宝宝的,《水恋湾风味酸奶奶嘴瓶》\r\n很有趣的奶嘴酸奶 ，让你像个小宝宝一样喝酸奶！一大班人吸奶嘴的画面肯定很好笑！快点买回去感受下吧️\r\n\r\n#水恋湾＃奶瓶＃酸奶', '中国', 'China', '2021-05-11 21:56:38', '2021-05-12 10:33:03'),
(49, '伊利优酸乳250ml', 'Yiliyou Yogurt 250ml', '【伊利优酸乳 250毫升 】\r\n\r\n陈立农和周冬雨一起代言伊利优酸乳啦~\r\n\r\n伊利优酸乳严选牧场奶源，坚守更优品质 每一口酸甜好滋味都带给你满满活力。\r\n\r\n 初恋的酸甜，热恋的甜蜜，优酸乳也可以给你一样的感觉 ~', '中国', 'China', '2021-05-11 21:59:43', '2021-05-12 10:10:54'),
(50, '达能脉动 600ml', 'DaNeng MaiDong 600ml', '无碳酸气的脉动不会引起胃部胀气，而且富含多种营养，让你随时补充水分保持动力。而且还有多种清新的水果口味，喝起来口感清爽的同时也注入更多活力！', '中国', 'China', '2021-05-11 22:02:28', '2021-05-13 11:57:11'),
(51, '香飘飘烤奶茶280ml', 'Xiang Piao Piao Roasted Milk Tea 280ml', '香飘飘又双叒叕出新品啦！香飘飘的新品一般都是有品质保证，并且味道一定要让人眼前一亮的。首先就先让凯凯王俊凯来为你介绍，这三款新上市的烤奶茶咯~香飘飘特选采用上好的茶叶现萃出来的茶汤，加入进口浓缩牛奶以及经过匠心烘焙的茶叶，看茶焙茶，不同的茶叶要有不同的焙茶手法，才能做出很精彩的烤奶茶！', '中国', 'China', '2021-05-11 22:04:36', '2021-05-13 07:36:52'),
(52, '家乡人酸辣粉', 'JiaXiangRen Sour and Spicy Noodles', '『家乡人正宗重庆酸辣粉』\r\n\r\n✔独特热风烘干工艺，易消化，不上火，粉丝韧性十足，晶莹剔透。\r\n✔味道麻、辣、鲜、香、酸，油而不腻，辣而不燥。\r\n✔酸辣爽口，诱人的香味牵动你的味蕾！\r\n\r\n▶主要是由红薯加工而成，常吃红薯的人可以有效预防肠癌，因此酸辣粉也是一种养颜，开味，健胃的特色小吃，集麻，辣，香于一体，特别受到型男靓女的追捧。\r\n\r\n▶只要打开包装到开水冲泡只需要几分钟时间，但功夫往往在幕后，汤料的熬酱调制，粉丝的精工制作不是一刻的功夫，尤其是有特色口味的酸辣粉，更是有其独特的秘方和深厚的功底。\r\n\r\n▶家乡人正宗重庆酸辣粉酸辣粉 正是在重庆风味的基础上,根据自己多年酸辣粉的经验，柔和四川的尖辣，加上武汉风味，口味独特，汤料鲜美。家乡人正宗重庆酸辣粉的粉条晶莹透亮，有很好的韧性而且比较粗。粉条的粗细对口感有着重要的影响，所以酸辣粉必须要粗才好吃。现在人们吃的粉条越来越粗越来越宽，我们平时吃火锅时也放上一些粉丝之类，也有的是红薯粉，但酸辣粉的粉丝更粗更有咬劲。', '中国', 'China', '2021-05-11 22:05:56', '2021-05-12 09:24:30'),
(53, '家乡人螺蛳粉', 'JiaXiangRen Snail noodles', '家乡人的螺蛳粉\r\n螺蛳粉有一个一口上瘾定律， 你听过吗？那就是闻着臭，看着馋，吃着香！ 家乡人的螺蛳粉酸香鲜辣，搭配多种配料。\r\n螺蛳粉一般采用很爽口的米粉，加上花生，油炸腐竹，黄花菜，萝卜干和鲜嫩青菜等等配料，并且搭配酸辣口味以及煮烂螺蛳的汤水调和而成，那个奇特的味道就是来自于螺蛳粉的灵魂——酸笋啦！只要你吃过一次就不会抗拒他，而是会欲罢不能，就跟臭豆腐一样。', '中国', 'China', '2021-05-11 22:08:21', '2021-05-12 09:15:13'),
(54, '家乡人麻辣汤粉', 'JiaXiangRen Spicy soup noodles', '家乡人麻辣汤粉', '中国', 'China', '2021-05-11 22:11:35', '2021-05-11 22:12:41'),
(55, '白家阿宽红油面皮', 'BaiJia AhKuan Red oil pasta', '红油面皮是四川特色乾拌面\r\n酸辣口味 挑动你的味蕾\r\n食用方法：\r\n\r\n1. 开袋后，取出调料包，将面饼放入碗中，加入90度以上沸水约600ml,加盖放置。同时将油包放在盖子上预热\r\n\r\n2. 滤水：5分钟后，将水倒掉\r\n\r\n3. 加料：加入调味料，搅拌均匀后即可食用，可加入烫熟的蔬菜，葱花等，风味更佳', '中国', 'China', '2021-05-11 22:12:51', '2021-05-12 09:02:17'),
(56, '好哥们重庆小面', 'HaoGeMen Chongqing noodles', '好哥们重庆小面\r\n手工揉制加上用小麦高筋制作而成的干面，造就了一碗劲道十足的面条！由于重庆小面十一万简单的面，所以在配料方面没有过于复杂，反而在调料上就非常讲究！', '中国', 'China', '2021-05-11 22:13:51', '2021-05-12 08:55:10'),
