(58, '紫山刀削面 盒装', 'ZiShan Sliced Noodles Boxed', '紫山到饭点日式非油炸刀削面哦～\r\n\r\n正宗豚骨刀削面，肉香纯正，浓郁汤汁～\r\n\r\n刀削面口感纯正，自热方便快捷～\r\n\r\n最最最主要啦15分钟即可享受美食啦～', '中国', 'China', '2021-05-11 22:16:37', '2021-05-12 08:41:30'),
(59, '小龙坎酸辣粉', 'Xiaolongkan Hot and Sour Noodles', '小龙坎酸辣粉念念不忘——Q弹爽口，酸辣爽滑！他们家的红薯淀粉和木薯淀粉混合制成的，更加晶莹剔透，口感更有嚼劲，也比较容易冲泡，没有经过油炸的粉条口感更加软糯幼滑，吃过一口就觉得粉条在你的舌尖舞动~\r\n\r\n除此之外，香辣带劲又够呛的汤底，淋上香醋做更上一层楼的点缀，让酸辣粉酸得够力，辣得带劲。配上一些配料啊，花生等等，丰富的口感和味道越吃越开胃，越吃越香，真不愧是小龙坎啊！最重要的是，只要用热水冲泡4-6分钟就可以吃了，方便到爆！', '中国', 'China', '2021-05-11 22:18:21', '2021-05-12 08:33:06'),
