(78, '天喔茶庄C满E柠檬+水蜜桃', 'Tian Oh Cha Zhuang C Full E', 'C 给你内在美。E 给你外在美\r\nC 满 E 我要陪你美下去 ❤\r\n\r\n天喔茶庄C满E产品将柠檬+水蜜桃打造口感时尚的复合果汁饮料系列，同时将VC、VE完美结合，倡导内外兼修，呼唤青春美丽基因，引领消费者健康生活观。', '中国', 'China', '2021-05-13 12:05:41', '2021-05-13 12:11:13'),
(79, '天喔茶庄蜂蜜柚子茶', 'Tian Oh Cha Zhuang Honey Citron Tea', '天喔茶庄 蜂蜜柚子茶 果味茶 500ML  \r\n天喔蜂蜜柚子茶将全天然的蜂蜜与健康的水果柚子相结合，\r\n调制出甜蜜、清新、滋润的口感；在外形包装上，\r\n天喔蜂蜜柚子茶沿袭了天喔皇家系列所独具的时尚感和个性化，\r\n浅绿色的包装给人以健康、舒适、精致之感。', '中国', 'China', '2021-05-13 12:11:53', '2021-05-13 12:15:00'),
(80, '安慕希希腊酸奶', 'Anmuxi yogurt / Ambrosial Greek Yogurt', '安慕希的英文名字叫Ambrosial，这个名字来自希腊，用来形容特别美味的东西。所以安慕希的风味，是浓浓的希腊风，浓厚的口感和多了35%的蛋白质，超级受欢迎的啊！\r\n现在安慕希没那么难买了，但要试全所有的口味也是不容易滴~就让我为你介绍，安慕希的大家族到底有什么口味吧！\r\n包装205g\r\n➤ 浓醇顺滑原味\r\n➤ 清香顺滑香草口味\r\n➤ 舌尖美味蓝莓口味\r\n➤ 满满草莓草莓口味\r\n➤顺滑醇厚咖啡+酸奶\r\n高端230g\r\n➤ 高端原味\r\n➤ 馥郁果汁芒果百香果味\r\n➤ 浓郁果肉橙凤梨味\r\n➤奇异果青葡萄的创新口味\r\n燕麦高端200g\r\n➤ 真实果粒黄桃燕麦味\r\n➤ 真实果粒草莓燕麦味\r\n➤浓浓果香葡萄柚青桔\r\n➤浓郁的芝士味', '中国', 'China', '2021-05-13 12:19:06', '2021-05-13 12:56:55'),
(81, '安慕希酸奶高端系列', 'Anmuxi Premium Series', '浓浓安慕希非常受大家欢迎，特别是高端系列的，那顺滑的口感，那醇厚的滋味，绝对不是一般酸奶能匹比的。\r\n安慕希的酸奶是用纯正的牛乳发酵的，匠心制作浓郁好品质的酸奶。经过多重优质工艺，才能铸就丝滑的口感，装在便携的瓶装里，美味马上就能畅快享受！比标准的酸奶蛋白质含量多了整整35%，名副其实的营养满满！新的口味采用了奇异果和青葡萄，两者都是多肉多汁的水果，味道清新，为酸奶注入更多的营养和加倍的美味~', '中国', 'China', '2021-05-13 13:11:11', '2021-05-13 13:23:57'),
(82, '喜之郎果肉果冻布丁', 'XI ZHI LANG Fruit Jelly', '【喜之郎果冻】\r\n‍‍‍‍‍‍ \r\n有时候胃口不好，什么都不想吃的时候，也许你可以考虑来个喜之郎的果冻，本店为你介绍清凉的喜之郎果冻可以让你胃口大增！\r\n\r\n?喜之郎的果冻口感爽滑，多种水果口味让你倍感清新，而且还富含儿童成长所需的膳食纤维。看得见果肉的水果果冻更是增加了有益菌，促进肠胃蠕动。\r\n\r\n?把健康美味的喜之郎果冻带回家，就是把爱和欢乐带回家，快来本店把喜之郎果冻带回家给全家人享用吧！', '中国', 'China', '2021-05-13 13:27:40', '2021-05-13 13:43:40'),
(83, '皇族 麻糬', 'ROYAL FAMILY MOCHI', '台湾麻糬\r\n有人叫它麻糬\r\n有人叫它大福\r\n不管它叫什么\r\n都是最有味道的零食\r\n世上零食万万千\r\n独爱麻糬还有谁？\r\nQ弹的外皮搭配各种不同内馅\r\n独有的口感满足了吃货的心', '台湾', 'Taiwan', '2021-05-13 13:48:20', '2021-05-13 14:00:51'),
