(93, '老干妈酱料系列', 'LAO GAN MA CHILI', '火遍全球的老干妈辣酱，只要有华人的地方就有老干妈辣酱！多种口味选择！\r\n\r\n油辣椒：这一瓶是老干妈的基础入门款，也是经典款之一，这瓶比较万能，拌饭、面和做蘸水都可以，是回购率最高的一款，用鼻子闻气味，辣椒的味道很香醇，配有大颗的脆生米，吃面的时候不会觉得口感单调。\r\n\r\n风味豆豉-油制辣椒：这是老干妈的第二大经典口味，由油辣椒+腌渍过的豆豉组成，但由于很多人吃不惯豆豉的味道，所以这瓶受欢迎程度分两极,因为豆豉的原因，这瓶口味有些偏咸，开盖后有很浓的豆豉味道，但不是臭臭的那种，适合夹在馒头里吃。\r\n\r\n精制牛肉末-豆豉油辣椒：这瓶其实就是在豆豉油辣椒的基础上加了一些牛肉末，开盖后不再是浓郁的豆豉味，多了一些牛肉的香气。\r\n\r\n风味鸡油辣椒：这一瓶鸡油辣椒是真的有大块鸡肉在里面，味道也很有贵州辣子鸡的风味，一开盖就能闻到很浓的辣子鸡香气，而且辣椒里面鸡肉的含量还不少，有的还是没带骨头的纯肉。\r\n\r\n干煸肉丝油辣椒：这瓶也是含肉的辣椒油，口感比较咸，但是含肉量高，辣椒香气浓，肉丝很大块，但是口感比较硬，吃起来像肉干，推荐给牙口比较好的人。（不得不说老干妈放肉还是挺舍得的）\r\n\r\n辣三丁油辣椒：辣三丁，顾名思义就是有三种食材组成，分别是：豆腐干、大头菜、花生米，一开盖就能闻到很香的气味，感觉比较适合拿来做下酒菜，可以尝试用来做凉拌菜的调料。\r\n\r\n番茄辣酱：这一瓶也是新包装、新口味，看起来最人畜无害的一瓶没想到是十几瓶里面最辣的，吃了一小口就被辣到脸红，味道闻起来很开胃，吃起来是酸辣的，和贵州的糟辣椒很像，适合拿来煮火锅吃，不能吃辣的朋友慎入。\r\n\r\n肉丝豆豉油辣椒：这一瓶油辣椒是味道最刺鼻的一款，豆豉味很浓郁，能接受的人应该比较少，豆豉有分为黑豆做的，黄豆做的，这瓶应该就是用黄豆做的，有一些臭臭的，口感也偏硬，肉丝也比较少。\r\n\r\n香辣菜：老干妈的香辣菜相信大部分的人都吃过，可以用来配粥、包馒头、炒菜用，是另一种形式的榨菜。\r\n\r\n香辣脆油辣椒：这款是比较偏淡的辣椒气味，纯辣椒保留辣椒原有的风味。\r\n\r\n红油腐乳：老干妈的红油腐乳开盖后，只有淡淡辣油的味道，但是吃起来口味还不错，老干妈的腐乳比较小块，一次正好可以吃一块，不容易浪费，吃起来有一点沙沙的口感。', '中国', 'China', '2021-05-14 06:48:28', '2021-05-14 07:54:41'),
(94, '韩国皇冠榛果巧克力酱威化饼条', 'Crown Heim Wafer Stick', '韩国皇冠榛果巧克力酱威化饼条 白巧克力 巧克力 142g （9包/盒）\r\n\r\n韩国制作进口、上班族、团购、大人小孩都喜欢吃的零嘴！香脆饼皮裹覆着香浓巧克力/白巧克力，浓郁顺口好吃，酥脆饼皮香脆，榛果夹心内馅满满得超浓郁，而且甜而不腻！。个别小包装方便携带，绝对是你的第一选择！', '韩国', 'Korea', '2021-05-14 09:04:48', '2021-05-14 09:16:55'),
(95, '农夫山泉 水溶 C100 果汁饮料', 'Nongfu Spring C100 Fruit Juice', '水溶C100是农夫山泉公司出品的一款柠檬味复合果汁饮料，补充维生素C为其主要功能，因口感独特，造型清新出众而深受年轻人的喜爱，如今已有多种口味供消费者选择。给夏日带来一份清爽。\r\n\r\n备注：饮品的某些成分可能会引起过敏反应，饮用前请参阅原包装上的饮品成分标签。', '中国', 'China', '2021-05-14 09:45:26', '2021-05-14 09:56:16'),
(96, '伊然 乳矿奶茶 400ml', 'Yili Milk Tea  400ml', 'Hello Kitty Yili Milk Tea No Cane Sugar Low Fat Hello Kitty 联名款伊利伊然乳矿奶茶0蔗糖低脂 [400ML]\r\n\r\n❤ No Cane Sugar 0蔗糖\r\n❤Low Fat 低脂\r\n❤Low Calorie 低卡路里\r\n❤ Good replacement for Milk Tea Lover 奶茶控的快乐水', '中国', 'China', '2021-05-14 09:58:20', '2021-05-14 10:03:35'),
(97, '新希望 V美饭后半小时乳酸菌', 'V美 Lactobacillus', '饭后半小时，适合散散步走走让肠胃稍稍可以消化下，但如果你太懒了，那你可能需要新希望的六果三蔬乳酸菌饮料！要肠胃蠕动，那就来瓶乳酸菌为你的健康助力吧！新希望的饭后半小时乳酸菌，一共添加了9种蔬果，并且整体蔬果汁的含量高达15%！除此之外还有6种乳酸菌在饮料里面，喝起来酸酸甜甜，丝滑非常。除了原味的，添加了蓝莓和草莓味的乳酸菌饮料更为香甜，唇齿留香哦！\r\n\r\n➤ 香蕉牛奶饮品\r\n\r\n香甜的新鲜香蕉制成容易保存的香蕉酱，再和荷斯坦奶牛的新鲜牛奶做搭配，蛋白质比普通牛奶还高！喝上去还有蜂蜜的香气哦', '中国', 'China', '2021-05-14 10:08:12', '2021-05-14 10:26:21'),
(98, '白家陈记酸辣粉丝 108g', 'Bai Jia Chen Ji Instant Noodle Series 108g', '白家陈记重庆酸辣粉\r\n\r\n第一次尝到这产品的感觉是什么？实惠，好吃，健康，方便！为何呢？粉丝是非油炸制作，而且免煮，所以吃起来身体没负担，更健康，随时想吃时热水一泡很快就可以吃了，所以很方便，不必身在重庆，吃上一碗就感觉身在重庆咯！最重要的是，价格还很便宜呢，所以连荷包的负担也小了！\r\n\r\n粉丝晶莹剔透，吃在嘴里感觉缠绵又清爽，麻辣的酱料配上陈年食醋，再加上随附的香葱，增香提味，料包里还有酥脆的小黄豆，在米线缠绵的口感之外再增加咀嚼的快感。\r\n\r\n白家陈记的粉丝团队，在这个夏天，冒着重庆的酷暑，吃遍重庆大街小巷的招牌酸辣粉，终得以中和出正宗重庆酸辣粉之味。凭借着自身多年的方便粉丝生产实力，今天将重庆酸辣粉送到您的面前。\r\n\r\n不到重庆，也能吃到正宗重庆酸辣味！', '中国', 'China', '2021-05-14 10:35:46', '2021-05-14 11:06:07'),
(99, '白家阿宽重庆小面麻辣味桶装 105g', 'Bai Jia Akuan ChongQing Hot & Spicy Instant Soup', '阿宽四川重庆麻辣小面\r\n\r\n重庆小面一款发源于重庆的一种特色传统小吃，是重庆面食中最简单的一种。\r\n重庆小面为何称为小面？在老重庆的语系中，小就是素的意思，所以重庆麻辣小面指的就是麻辣素面，即是没加佐料的面食。有分干面与汤面两种类型。\r\n阿宽麻辣小面采用传统工艺制成的红油辣子，加上芝麻让麻辣鲜香的滋味更加香浓！阿宽酸辣小面则是在麻辣的调味基础上增加了粮食发酵的醇厚老陈醋，添加醇厚酸爽的口感滋味。\r\n阿宽重庆小面的使用方法非常简单方便，干面皮不需水煮，直接以开水冲泡6分钟后，然后加入调味料拌匀，可以随个人喜好添加时蔬，即可食用。\r\n阿宽面皮非油炸制作，而是以高温熟化干燥而成，让方便美食更健康，更美味！', '中国', 'China', '2021-05-14 11:06:26', '2021-05-14 11:16:13'),
(100, '康师傅葱烧排骨面 桶装114g', 'MASTER KANG PORK RIB NOODLE Cup 114g', '【康师傅葱烧排骨面】\r\n严选上好排骨肉，出水后融合地道的酱料先翻炒再以中火炖烧细烹入味，酱香鲜浓醇厚，勾人食欲，再搭配爽滑的面条，嗯，这个味儿香！??\r\n康师傅面都是真材实料，现在加上更丰富的配料，急火爆香，小火慢炖，汤头更香浓，面粉多加鸡蛋并有精湛工艺生产出的面条，更营养更爽滑，吃不断的营养美味！❤️?', '中国', 'China', '2021-05-14 11:28:12', '2021-05-14 11:31:39'),
