(103, '江记福州鱼丸', 'Fuzhou Meat Fish Ball', '江记福州鱼丸里面馅料是猪肉', '马来西亚', 'Malaysia', '2021-05-14 20:58:49', '2021-05-14 21:09:37'),
(104, 'LOUIS RICH 猪排', 'LOUIS RICH THAI PORK STEAK', '- 此猪排已用美味的调味料腌制，您只需10分钟就可以方便快捷地煮好。\r\n\r\n- 用了瘦肉和脂肪比例高的猪肩肉制成，简直就是多汁、嫩滑、美味的体验。\r\n\r\n4种口味可供选择：\r\n\r\n☞原味：清淡的调味料，带有芳香温和的西方草药香气。\r\n☞黑胡椒：烟熏黑胡椒，略带辣味，适合大众的口味。\r\n☞韩式酱汁：韩式的丰富甜香味。\r\n☞日本烧汁：日本烤肉用的经典味道醇厚的烧汁味\r\n\r\n烹饪说明：解冻，用平底锅每面煎约5分钟，或用空气煎锅在180摄氏度下烤4-5分钟。', '马来西亚', 'Malaysia', '2021-05-15 04:48:56', '2021-05-15 05:15:11'),
